import React, { Component } from "react";
// import { Wrapper, Status } from "@googlemaps/react-wrapper";
import { GoogleMap, LoadScript } from "@react-google-maps/api";
import axios from 'axios';
import { useEffect, useState } from "react";
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Image from 'react-bootstrap/Image'
import $ from 'jquery';

const containerStyle = {
    width: '100%',
    height: '80vh'
};
  
const center = {
  lat: 35.118620223842,
  lng: 129.0959130382
};
const MapPage = () => {
    const url = "http://travelbusanko.com";
    let loc_id = "LOC001";
    
    axios.get(url + `/api/view/image/${loc_id}`, {
        headers: {
            "Content-Type": `application/json`,
        }
    }).then((res) => {
        var data = res.data;
        var innerHTML = "";
        for(var i=0; i<data.length; i++){
          innerHTML += "<Image src=require('./" + data[i].saved_path + ")' />" ;

        }
        $('.image__viewer').html(innerHTML);

    })
    
    return (
      <Container>
        <Row>
          <Col>
            <LoadScript googleMapsApiKey="AIzaSyB-RafIQqKjj2kactuwVHkuoulZSKA4rSs">
              <GoogleMap
                bootstrapURLKeys={{key:"AIzaSyB-RafIQqKjj2kactuwVHkuoulZSKA4rSs"}}
                mapContainerStyle={containerStyle}
                center={center}
                zoom={14}
              >
                { /* Child components, such as markers, info windows, etc. */ }
                <></>
              </GoogleMap>
            </LoadScript>
          </Col>
          <Col>
            <div className="image__viewer">
            
            </div>
          </Col>
        </Row>
      </Container>
      
              
    );
    
}

  
export default MapPage;
